import React from "react";
import Navbar from "./Navbar";

const webinars = [
  {
    id: 1,
    title: "Atlas-Chat: Adapting Large Language Models for Low-Resource Moroccan Arabic Dialect",
    speakers: ["Dr. Guokan Shang", "Yousef Khoubrane"],
    roles: ["Lead Research Scientist, MBZUAI France Lab", "Graduate Student, UM6P"],
    location: ["France", "Morocco"],
    date: "OCTOBER 31ST, 2024",
    time: "19H MA / 20H FR",
  },
  {
    id: 2,
    title: "From Qubits to Clinics: Enhancing Cancer Diagnosis with Quantum Machine Learning",
    speakers: ["Walid El Maouaki"],
    roles: ["PhD Student, Hassan II University"],
    location: ["Casablanca, Morocco"],
    date: "SEPTEMBER 27TH, 2024",
    time: "20H RABAT",
  },
  {
    id: 3,
    title: "Algorithms with Untrusted Predictions",
    speakers: ["Ziyad Benomar"],
    roles: ["PhD Student, ENSAE"],
    location: ["Paris, France"],
    date: "JULY 10TH, 2024",
    time: "20H RABAT / 21H PARIS",
  },
  // Add additional 6 webinars here...
];

function Webinars() {
  return (
    <div className="bg-gray-50">
      <Navbar />
      <div className="mt-16 p-8">
        {/* Adds margin-top to start below Navbar */}
         {/* Adds margin-top to start below Navbar */}
          {/* Adds margin-top to start below Navbar */}
        <div className="text-4xl font-bold mb-6 text-center mt-6">Previous Webinars</div>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {webinars.map((webinar) => (
            <div
              key={webinar.id}
              className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition"
            >
              <h2 className="text-xl font-bold mb-2 text-blue-600">
                {webinar.title}
              </h2>
              {webinar.speakers.map((speaker, index) => (
                <div key={index} className="mb-2">
                  <p className="text-md font-semibold text-gray-800">{speaker}</p>
                  <p className="text-sm text-gray-600">{webinar.roles[index]}</p>
                  <p className="text-sm text-gray-500">{webinar.location[index]}</p>
                </div>
              ))}
              <div className="mt-4">
                <p className="text-gray-700 font-medium">{webinar.date}</p>
                <p className="text-gray-500">{webinar.time}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Webinars;
